import Search from "./search";
import { delAllInfo } from "../../../api/monitor/log";
import CRUD, { presenter } from "../../../components/Crud/crud";
import crudOperation from "../../../components/Crud/CRUD.operation";
import pagination from "../../../components/Crud/Pagination"; // crud交由presenter持有

var defaultCrud = CRUD({
  title: '日志',
  url: 'api/logs',
  sort: ''
});
export default {
  name: 'Log',
  components: {
    Search: Search,
    crudOperation: crudOperation,
    pagination: pagination
  },
  mixins: [presenter(defaultCrud)],
  data: function data() {
    return {
      permission: {
        clear: ['operLog:clear']
      }
    };
  },
  created: function created() {
    this.crud.optShow = {
      add: false,
      edit: false,
      del: false,
      download: true
    };
  },
  methods: {
    confirmDelAll: function confirmDelAll() {
      var _this = this;

      this.$confirm("\u786E\u8BA4\u6E05\u7A7A\u6240\u6709\u64CD\u4F5C\u65E5\u5FD7\u5417?", '提示', {
        confirmButtonText: '确定',
        cancelButtonText: '取消',
        type: 'warning'
      }).then(function () {
        _this.crud.delAllLoading = true;
        delAllInfo().then(function (res) {
          _this.crud.delAllLoading = false;

          _this.crud.dleChangePage(1);

          _this.crud.delSuccessNotify();

          _this.crud.toQuery();
        }).catch(function (err) {
          _this.crud.delAllLoading = false;
          console.log(err.response.data.message);
        });
      }).catch(function () {});
    }
  }
};
